import React, { Component, useEffect, useState } from "react";
import "./css/motorcycle_info.css";
import "./css_admin.css";
import Paper from '@mui/material/Paper';
import Table from '@mui/material/Table';
import TableBody from '@mui/material/TableBody';
import TableCell from '@mui/material/TableCell';
import TableContainer from '@mui/material/TableContainer';
import TableHead from '@mui/material/TableHead';
import TablePagination from '@mui/material/TablePagination';
import TableRow from '@mui/material/TableRow';
import { Navigate } from 'react-router-dom';
import Button from '@mui/material/Button';

export default function MotorcycleInfoAdmin() {
     const [items,setItems] = useState([]);
   const [users, setUsers] = useState([]);
   useEffect(()=>{
     UserGet()
     MotorcycleGet()
   });

   const MotorcycleGet = () => {
     fetch("http://localhost:3001/api/v1/motorcycles")
       .then(res => res.json())
       .then((result) => {
         if (result !== null && Array.isArray(result)) {
           // ตรวจสอบว่า result เป็น array หรือไม่ เพื่อป้องกันกรณีที่ result ไม่ใช่ array หรือมีค่าเป็น null
           // ถ้าเป็น array ให้ทำการเช็ค USER_ID ในแต่ละไอเทมและดำเนินการตามที่ต้องการ
           const filteredItems = result.filter((item) => item.USER_ID !== null);
           setItems(filteredItems.map(item => {
             const user = users.find(u => u.USER_ID === item.USER_ID);
             return {
               ...item,
               USER_FULLNAME: user ? user.USER_FULLNAME : 'N/A' // ถ้าไม่พบ user ในข้อมูลให้กำหนด USER_FULLNAME เป็น 'N/A'
             };
           }));
         } else {
           setItems([]);
         }
       })
      .catch(error => console.error('Error fetching motorcycles:', error));
     }
  

   const UserGet = () => {
     fetch("http://localhost:3001/api/v1/users")
       .then(res => res.json())
       .then((result) => {
         setUsers(result);
       })
       .catch(error => console.error('Error fetching users:', error));
   }

   const MotorcycleDelete = (MOTORCYCLE_ID) => {
     var requestOptions = {
       method: 'DELETE',
       redirect: 'follow'
     };
  
     fetch(`http://localhost:3001/api/v1/motorcycles/${MOTORCYCLE_ID}`, requestOptions)
       .then(response => response.text())
       .then(result => console.log(result))
       .catch(error => console.log('error', error));
   }

   const MotorcycleUpdate = (MOTORCYCLE_ID)=>{
     window.location = '/admin/update-motorcycle/'+ MOTORCYCLE_ID
   }

  const [page, setPage] = React.useState(0);
  const [rowsPerPage, setRowsPerPage] = React.useState(10);

  const handleChangePage = (event, newPage) => {
    setPage(newPage);
  };

  const handleChangeRowsPerPage = (event) => {
    setRowsPerPage(+event.target.value);
    setPage(0);
  };

  const [gotoAddMotorcycle,setGotoAddMotorcycle] = React.useState(false);
   if(gotoAddMotorcycle){
       return <Navigate to = "/admin/add-motorcycle" />;
   }

  return (
    <diV>
      <div class="bg-image h-100" style="background-color: #F5DF4D;">
    <div class="mask d-flex align-items-center h-100">
      <div class="container">
        <div class="row">
          <div class="col-md-10 col-lg-8 col-xl-7 mx-auto">
            <div class="card mb-2">
              <div class="card-body d-flex justify-content-between py-2">
                <div class="input-group input-group-lg">
                  <span class="input-group-text border-0 px-1" id="basic-addon2"><i class="fas fa-search fa-lg" style="color: #939597;"></i></span>
                  <input type="text" class="form-control form-control-lg rounded" placeholder="Search"
                    aria-label="Search" aria-describedby="basic-addon2" />
                </div>
                <p class="mb-0 d-flex flex-row align-self-center" style="color: #939597;"><span class="font-weight-bold pe-1">108 </span>results</p>
              </div>
            </div>
            <div class="card">
              <div class="card-body p-4">
                <h6 class="mt-3 mb-4" style="color: #939597;">Advanced search</h6>
                <div class="row">
                  <div class="col-md-4 mb-3">
                    <div class="dropdown">
                      <a class="btn btn-outline-dark btn-rounded btn-lg btn-block dropdown-toggle" href="#" role="button"
                        id="dropdownMenuLink" data-mdb-toggle="dropdown" aria-expanded="false">
                        Accessories
                      </a>
                      <ul class="dropdown-menu" aria-labelledby="dropdownMenuLink">
                        <li><a class="dropdown-item" href="#">Action</a></li>
                        <li><a class="dropdown-item" href="#">Another action</a></li>
                        <li><a class="dropdown-item" href="#">Something else here</a></li>
                      </ul>
                    </div>
                  </div>
                  <div class="col-md-4 mb-3">
                    <div class="dropdown">
                      <a class="btn btn-outline-dark btn-rounded btn-lg btn-block dropdown-toggle" href="#" role="button"
                        id="dropdownMenuLink1" data-mdb-toggle="dropdown" aria-expanded="false">
                        Color
                      </a>
                      <ul class="dropdown-menu" aria-labelledby="dropdownMenuLink1">
                        <li><a class="dropdown-item" href="#">Action</a></li>
                        <li><a class="dropdown-item" href="#">Another action</a></li>
                        <li><a class="dropdown-item" href="#">Something else here</a></li>
                      </ul>
                    </div>
                  </div>
                  <div class="col-md-4 mb-3">
                    <div class="dropdown">
                      <a class="btn btn-outline-dark btn-rounded btn-lg btn-block dropdown-toggle" href="#" role="button"
                        id="dropdownMenuLink2" data-mdb-toggle="dropdown" aria-expanded="false">
                        Size
                      </a>
                      <ul class="dropdown-menu" aria-labelledby="dropdownMenuLink2">
                        <li><a class="dropdown-item" href="#">Action</a></li>
                        <li><a class="dropdown-item" href="#">Another action</a></li>
                        <li><a class="dropdown-item" href="#">Something else here</a></li>
                      </ul>
                    </div>
                  </div>
                </div>
                <div class="row">
                  <div class="col-md-4 mb-3">
                    <div class="dropdown">
                      <a class="btn btn-outline-dark btn-rounded btn-lg btn-block dropdown-toggle" href="#" role="button"
                        id="dropdownMenuLink3" data-mdb-toggle="dropdown" aria-expanded="false">
                        Sale
                      </a>
                      <ul class="dropdown-menu" aria-labelledby="dropdownMenuLink3">
                        <li><a class="dropdown-item" href="#">Action</a></li>
                        <li><a class="dropdown-item" href="#">Another action</a></li>
                        <li><a class="dropdown-item" href="#">Something else here</a></li>
                      </ul>
                    </div>
                  </div>
                  <div class="col-md-4 mb-3">
                    <div class="dropdown">
                      <a class="btn btn-outline-dark btn-rounded btn-lg btn-block dropdown-toggle" href="#" role="button"
                        id="dropdownMenuLink4" data-mdb-toggle="dropdown" aria-expanded="false">
                        Time
                      </a>
                      <ul class="dropdown-menu" aria-labelledby="dropdownMenuLink4">
                        <li><a class="dropdown-item" href="#">Action</a></li>
                        <li><a class="dropdown-item" href="#">Another action</a></li>
                        <li><a class="dropdown-item" href="#">Something else here</a></li>
                      </ul>
                    </div>
                  </div>
                  <div class="col-md-4 mb-3">
                    <div class="dropdown">
                      <a class="btn btn-outline-dark btn-rounded btn-lg btn-block dropdown-toggle" href="#" role="button"
                        id="dropdownMenuLink5" data-mdb-toggle="dropdown" aria-expanded="false">
                        Type
                      </a>
                      <ul class="dropdown-menu" aria-labelledby="dropdownMenuLink5">
                        <li><a class="dropdown-item" href="#">Action</a></li>
                        <li><a class="dropdown-item" href="#">Another action</a></li>
                        <li><a class="dropdown-item" href="#">Something else here</a></li>
                      </ul>
                    </div>
                  </div>
                </div>
                <div class="d-flex justify-content-between align-items-center mt-4">
                  <div>
                    <button type="button" class="btn btn-dark btn-rounded">Search</button>
                    <button type="button" class="btn btn-link btn-rounded" style="color: #939597;" data-mdb-ripple-color="dark">
                      Delete
                    </button>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  </div>
      <div>
           <button onClick={()=>{setGotoAddMotorcycle(true);}}>
        เพิ่มข้อมูล     </button></div>
      <Paper sx={{ width: '100%', overflow: 'hidden' }}>
      <TableContainer sx={{ maxHeight: 440 }}>
        <Table stickyHeader aria-label="sticky table">
          <TableHead>
          <TableRow>
             <TableCell>ชื่อลูกค้า</TableCell>
             <TableCell>เลขตัวถัง</TableCell>
             <TableCell>เลขทะเบียน</TableCell>
             <TableCell>แก้ไขข้อมูล</TableCell>
             <TableCell>ลบข้อมูล</TableCell>
           </TableRow>
          </TableHead>
          <TableBody>
            {items
              .slice(page * rowsPerPage, page * rowsPerPage + rowsPerPage)
              .map((row) => (
                             <TableRow
                               key={row.name}
                               sx={{ '&:last-child td, &:last-child th': { border: 0 } }}
                             >
                               <TableCell >{row.USER_FULLNAME}</TableCell>
                               <TableCell >{row.MOTORCYCLE_BUCKET_NUMBER}</TableCell>
                               <TableCell >{row.MOTORCYCLE_REGISTRATION_NUMBER}</TableCell>
                               <TableCell ><Button type="button" class="btn btn-warning" onClick={()=>MotorcycleUpdate(row.MOTORCYCLE_ID)}>แก้ไข</Button></TableCell>
                               <TableCell ><Button type="button" class="btn btn-danger" onClick={()=>MotorcycleDelete(row.MOTORCYCLE_ID)}>ลบ</Button></TableCell>
                             </TableRow>
                           ))}
          </TableBody>
        </Table>
      </TableContainer>
      <TablePagination
        rowsPerPageOptions={[10, 25, 100]}
        component="div"
        count={items.length}
        rowsPerPage={rowsPerPage}
        page={page}
        onPageChange={handleChangePage}
        onRowsPerPageChange={handleChangeRowsPerPage}
        labelRowsPerPage="จำนวนแถวต่อหน้า:"
        labelDisplayedRows={({ from, to, count }) => `${from}-${to} จากทั้งหมด ${count}`}
      />
    </Paper>
    </diV>
    
  );
}
